import React from 'react';
import { Button } from '../../components/Button';

export const Login = () => {
    return (
        <div className="flex items-center justify-center bg-red-500">
            <div className="flex flex-col justify-center items-center rounded-2xl border-4 border-neutral-400 max-w-xl m-40 p-10 bg-slate-500">
                <p className="text-2xl font-medium p-5">Sign In</p>
                <label>Email adress</label>
                <input placeholder="Enter email"></input>
                <label className="p-5">Password</label>
                <input placeholder="Password"></input>
                <Button background="" content={'Submit'}></Button>
                <p>
                    Forgot <a>password?</a>
                </p>
            </div>
        </div>
    );
};
